import styled from 'styled-components'
 
export const CardPerfil = styled.div`
width:100%;
height:30px;
display:flex;
margin-bottom: 24px;
justify-content: start; 
align-items: center;
>img{
    width: 44px;
    border-radius: 8px;
    margin-left: 10px;
    height: 34px;

}
>p{
    margin-left: 10px;

}

`
